// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./IMdaoPair.sol"; 

contract M3tTokenETHF is ERC20, Ownable {
    IERC20 immutable public USDT_TOKEN;
    IERC20 public MDao;
    address _wallet = 0x0342FC12CfB57621DED0438403Dc3AC63ac3bf31;
    uint64 UnlockTime = 1095 days;
    uint256 public priceM3t;
    uint256 public priceMDao;
    IMdaoPair public U2ETHF;

    struct LockInfo {
        uint64 lockTime;
        uint64 unlockTime;
        uint256 lockAmount;
        uint256 claimedAmount;
    }
    mapping (address => LockInfo) public lockInfos;

    constructor(address _usdt, address u2ethf) ERC20("M3T Token", "M3T") {
        USDT_TOKEN = IERC20(_usdt);
        U2ETHF = IMdaoPair(u2ethf);
        priceM3t = 50;
        _mint(address(this), 200000000e18);
    }

    function setPriceM3t(uint256 newPrice) public onlyOwner {
        priceM3t = newPrice;
    }

    function setPriceMDao(uint256 newPrice) public onlyOwner {
        priceMDao = newPrice;
    }

    function setMDao(address mdao) public onlyOwner {
        MDao = IERC20(mdao);
    }

    function setWallet(address newWallet) public onlyOwner {
        _wallet = newWallet;
    }

    function getETHFCost(uint256 uamount) public view returns(uint256 price) {
        (uint256 u, uint256 ethfu,) = U2ETHF.getReserves();
        price = ethfu / u * 1e6 * uamount;
    }

    function recharge(uint256 amount, uint256 payForm) external payable {
        require(amount > 0, "Amount Invalid");
        uint256 m3t = amount * priceM3t * 1e12;
        uint256 usdt = amount;
        if (lockInfos[msg.sender].lockTime == 0) {
            lockInfos[msg.sender].lockTime = uint64(block.timestamp);
            lockInfos[msg.sender].unlockTime = uint64(block.timestamp) + UnlockTime;
        }
        lockInfos[msg.sender].lockAmount += amount * 1e12;
        if (payForm == 0) {
            require(msg.value >= getETHFCost(amount), "Not enough ethf");
            payable(_wallet).transfer(getETHFCost(amount));
            if (msg.value > getETHFCost(amount)) {
                payable(msg.sender).transfer(msg.value - getETHFCost(amount));
            }
        } else if (payForm == 1) {
            bool success = USDT_TOKEN.transferFrom(
                msg.sender, _wallet, usdt
            );
            require(success, "Transfer Invalid");
        }

        IERC20(address(this)).transfer(msg.sender, m3t);
    }

    function getCanClaimMMC(address account) public view returns (uint256, uint256) {
        // amount * days / 3 year
        uint256 totalCanClaimAmountMDao = lockInfos[account].lockAmount * priceMDao;
        uint256 totalCanClaimAmount = totalCanClaimAmountMDao / UnlockTime * (block.timestamp - lockInfos[account].lockTime);
        return (totalCanClaimAmount, totalCanClaimAmount - lockInfos[account].claimedAmount);
    }

    function claim() public {
        (, uint256 nowCanClaimAmount) = getCanClaimMMC(msg.sender);
        require(nowCanClaimAmount > 0);
        MDao.transfer(msg.sender, nowCanClaimAmount);
        lockInfos[msg.sender].claimedAmount += nowCanClaimAmount;
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        uint256 currentAllowance = allowance(sender, _msgSender());
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, _msgSender(), currentAllowance - amount);
        }

        return true;
    }




    // //for test
    // mapping (address => bool) getTest;
    // uint256 totalTest = 40000000;
    // uint256 nowTest = 0;

    // function getTestToken() public {
    //     require(nowTest + 200000 <= totalTest);
    //     require(!getTest[msg.sender]);
    //     _mint(msg.sender, 200000e18);
    //     nowTest += 200000;
    //     getTest[msg.sender] = true;
    // }

    // function canGetTestToken(address account) public view returns(bool) {
    //     return getTest[account];
    // }
}
